ault/" target="_blank">لماذا؟</a> (تفتح في صفحة جديدة)<br />» <a class="ai1wm-no-underline" href="https://wordpress.org/support/view/plugin-reviews/all-in-one-wp-migration?rate=5#postform" target="_blank">اختياريًا، مراجعة الإضافة</a>. (تفتح في صفحة جديدة)','» <a class="ai1wm-no-underline" href="%s" target="_blank">Save permalinks structure</a>. (opens a new window)<br />» <a class="ai1wm-no-underline" href="https://oxygenbuilder.com/documentation/other/importing-exporting/#resigning" target="_blank">Re-sign Oxygen Builder shortcodes</a>. (opens a new window)<br />» <a class="ai1wm-no-underline" href="https://wordpress.org/support/view/plugin-reviews/all-in-one-wp-migration?rate=5#postform" target="_blank">Optionally, review the plugin</a>. (opens a new window)'=>'» <a class="ai1wm-no-underline" href="%s" target="_blank">حفظ تركيبة الروابط الدائمة</a>. (تفتح في صفحة جديدة)<br />» <a class="ai1wm-no-underline" href="https://oxygenbuilder.com/documentation/other/importing-exporting/#resigning" target="_blank">إعادة تسجيل لـ Oxygen Builder للأكواد القصيرة</a>. (تفتح في صفحة جديدة)<br />» <a class="ai1wm-no-underline" href="https://wordpress.org/support/view/plugin-reviews/all-in-one-wp-migration?rate=5#postform" target="_blank">اختياريًا، مراجعة الإضافة</a>. (تفتح في صفحة جديدة)','Retrieving a list of WordPress media files...'=>'جاري استرجاع قائمة ملفات وسائط ووردبريس...','Done retrieving a list of WordPress media files.'=>'تم الانتهاء من استرجاع قائمة ملفات وسائط ووردبريس.','Retrieving a list of WordPress content files...'=>'جاري استرجاع قائمة ملفات محتوى ووردبريس...','Done retrieving a list of WordPress content files.'=>'تم الانتهاء من استرجاع قائمة ملفات محتوى ووردبريس.','Archiving %d content files...<br />%d%% complete'=>'جاري أرشفة %d ملفات محتوى...<br />%d%% مكتمل','Archiving %d media files...<br />%d%% complete'=>'جاري أرشفة %d ملفات وسائط...<br />%d%% مكتمل','I have enough disk space'=>'لديّ مساحة كافية على القرص','There is not enough space available on the disk.<br />Free up %s of disk space.'=>'لا تتوفر مساحة كافية على القرص.<br />حرّر %s من مساحة القرص.','Done preparing options.'=>'تم الانتهاء من تجهيز الإعدادات.','%s is not the latest version. You must update the plugin before you can use it. '=>'إضافة %s ليست على أحدث إصدار. يجب عليك تحديث الإضافة قبل أن تتمكن من استخدامها.','Refreshing backup list...'=>'تحديث قائمة النسخ الاحتياطي...','<h3>Site could not be imported</h3><p>Please make sure that storage directory <strong>%s</strong> has read and write permissions.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">Technical details</a></p>'=>'<h3>لا يمكن استيراد الموقع</h3><p>يرجى التأكد من أنّ دليل التخزين <strong>%s</strong> لديه أذونات للقراءة والكتابة.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">التفاصيل التقنية</a></p>','<h3>Site could not be exported</h3><p>Please make sure that storage directory <strong>%s</strong> has read and write permissions.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">Technical details</a></p>'=>'<h3>لا يمكن تصدير الموقع</h3><p>يرجى التأكد من أنّ دليل التخزين <strong>%s</strong> لديه أذونات للقراءة والكتابة.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">التفاصيل التقنية</a></p>','<h3>Site could not be restored</h3><p>Please make sure that storage directory <strong>%s</strong> has read and write permissions.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">Technical details</a></p>'=>'<h3>لا يمكن استعادة الموقع</h3><p>يرجى التأكد من أنّ دليل التخزين <strong>%s</strong> لديه أذونات للقراءة والكتابة.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">التفاصيل التقنية</a></p>','All-in-One WP Migration: Your current profile role does not have Export/Import capabilities enabled. <a href="https://help.servmask.com/knowledgebase/how-to-add-import-and-export-capabilities-to-wordpress-users/" target="_blank">Technical details</a>'=>'إضافة All-in-One WP Migration: رتبة ملفك الشخصي الحالية ليس بها إمكانيات وصلاحيات مفعلة للتصدير/الاستيراد. <a href="https://help.servmask.com/knowledgebase/how-to-add-import-and-export-capabilities-to-wordpress-users/" target="_blank">التفاصيل التقنية</a>','To choose a file please go inside the link and click on the browse button.'=>'لاختيار ملف، يرجى الانتقال إلى الرابط، ومن ثمّ النقر على زرّ المستعرض.','» <a class="ai1wm-no-underline" href="%s" target="_blank">Save permalinks structure</a>. (opens a new window)<br />» <a class="ai1wm-no-underline" href="https://wordpress.org/support/view/plugin-reviews/all-in-one-wp-migration?rate=5#postform" target="_blank">Optionally, review the plugin</a>. (opens a new window)'=>'» <a class="ai1wm-no-underline" href="%s" target="_blank">حفظ تركيبة الروابط الدائمة</a>. (تفتح في صفحة جديدة)<br />» <a class="ai1wm-no-underline" href="https://wordpress.org/support/view/plugin-reviews/all-in-one-wp-migration?rate=5#postform" target="_blank">اختياريًا، مراجعة الإضافة</a>. (تفتح في صفحة جديدة)','Finish'=>'إنهاء','"Restore" functionality is available in a <a href="https://servmask.com/products/unlimited-extension" target="_blank">paid extension</a>.<br />You could also download the backup and then use "Import from file".'=>'تتوفر وظيفة "الاستعادة" في <a href="https://servmask.com/products/unlimited-extension" target="_blank">الإضافة الملحقة المدفوعة</a>.<br /> يمكنك أيضًا تنزيل النسخة الاحتياطية ثم استخدام "استيراد من ملف".','Click to set a label for this backup'=>'أنقر لتعيين تسمية لهذه النسخة الاحتياطية','<a href="%s" class="ai1wm-button-green ai1wm-emphasize ai1wm-button-download" title="%s" download="%s"><span>Download %s</span><em>Size: %s</em></a>'=>'<a href="%s" class="ai1wm-button-green ai1wm-emphasize ai1wm-button-download" title="%s" download="%s"><span>تنزيل %s</span><em>الحجم: %s</em></a>','