ng>%s</strong> is not the latest version. You must <a href="%s">update the plugin</a> before you can use it. <br />'=>'الإصدار <strong>%s</strong> ليس أحدث إصدار. يجب عليك <a href="%s">تحديث الإضافة</a> قبل أن تتمكن من استخدامها.<br />','All-in-One WP Migration is not able to create <strong>%s</strong> folder. You will need to create this folder and grant it read/write/execute permissions (0777) for the All-in-One WP Migration plugin to function properly.'=>'إضافة All in One WP Migration غير قادرة على إنشاء المجلد <strong>%s</strong>. ستحتاج إلى إنشاء هذا المجلد ومنحه أذونات القراءة/الكتابة/التنفيذ والإجراء (0777) لإضافة All in One WP Migration لتعمل بشكل صحيح.','All-in-One WP Migration is not able to create <strong>%s</strong> file. Try to change permissions of the parent folder or send us an email at <a href="mailto:support@servmask.com">support@servmask.com</a> for assistance.'=>'إضافة All in One WP Migration غير قادرة على إنشاء الملف <strong>%s</strong>. حاول تغيير أذونات(صلاحيات) المجلد الأب(الأصل) أو مراسلتنا عبر البريد الإلكتروني <a href="mailto:support@servmask.com">support@servmask.com</a> للحصول على المساعدة.','The file type that you have tried to upload is not compatible with this plugin. Please ensure that your file is a <strong>.wpress</strong> file that was created with the All-in-One WP migration plugin. <a href="https://help.servmask.com/knowledgebase/invalid-backup-file/" target="_blank">Technical details</a>'=>'نوع الملف الذي حاولت رفعه غير متوافق مع هذه الإضافة. الرجاء التأكد من أنّ الملف الخاص بك بصيغة ملف <strong>.wpress</strong> الذي تم إنشاؤه باستخدام إضافة All-in-One WP migration. <a href="https://help.servmask.com/knowledgebase/invalid-backup-file/" target="_blank">تفاصيل تقنية</a>','The file that you are trying to import is over the maximum upload file size limit of <strong>%s</strong>.<br />You can remove this restriction by purchasing our <a href="https://servmask.com/products/unlimited-extension" target="_blank">Unlimited Extension</a>.'